import React from 'react'
import{footerData} from './footerData'
import{FooterContainer,FooterLink,FooterWrap,FooterLinksContainer,
FooterLinksWrapper,FooterLinksItems,FooterLinkTitle} from './Footer'
function Footer() {
    return (
        <FooterContainer>
            <FooterWrap>
                <FooterLinksContainer>
                    <FooterLinksWrapper>
                  {footerData.slice(0,2).map((item,index)=>{
                      const{id,url,title,title2,url1}=item
                      return<FooterLinksItems key={index}>
                          <FooterLinkTitle>{title}</FooterLinkTitle>
                          <FooterLink to={url}>{title2}</FooterLink>
                      </FooterLinksItems>
                  })}
                    </FooterLinksWrapper>
                      <FooterLinksWrapper>
                  {footerData.slice(2).map((item)=>{
                      const{id,url,title,title2,url1}=item
                   
                      return<FooterLinksItems key={id}>
                          <FooterLinkTitle>{title}</FooterLinkTitle>
                          <FooterLink to={url}>{title2}</FooterLink>
                      </FooterLinksItems>
                  })}
                    </FooterLinksWrapper>
                </FooterLinksContainer>
            </FooterWrap>
            
        </FooterContainer>
    )
}

export default Footer
